import Member from './members/Member';

function Teammember() {
  return (
      <div className=''>
          <div className='navbar bg-dark text-white m-auto'>
            <h1>Our Member</h1>
          </div>
            <Member name = 'Hesham'/>
      </div>
  )
}

export default Teammember;
